#define READ_BUS_DEBUG	1
#define WRITE_BUS_DEBUG	1
#define WRITE_PROTECT	1
#define IO_SPACE_HADDR	(0x20 >> 1)	// address 0x2000

char trace = 0;

ISR (PCINT0_vect) {
	// The request handling has been moved out of the interrput so that the serial port interrupt is
	// not blocked for the entirety of the request, which is the bulk of the work the ardunio is doing
	// when the CPU is running
	bus_request = 1;
}

void check_bus_cycle()
{
	if (!bus_request)
		return;

	//noInterrupts();
	PCICR = 0x00;
	PCIFR = 0x00;
	bus_request = 0;

	register long addr = (((M68_XADDR_PIN & 0x7F) << 16) | (M68_HADDR_PIN << 8) | M68_LADDR_PIN) << 1;
	if (M68_IS_AS() && (M68_XADDR_PIN & 0x80) && addr < 0x4000) {

		// Read Operation
		if (M68_IS_READ()) {
			M68_HDATA_DDR = 0xFF;
			M68_LDATA_DDR = 0xFF;

			//#if READ_BUS_DEBUG
			if (READ_BUS_DEBUG || (trace && addr >= ROM_SIZE)) {
				Serial.write('R');
				Serial.print(addr, HEX);
				if (addr < mem_size) {
					Serial.write('|');
					Serial.print((mem[addr] << 8) | mem[addr + 1], HEX);
				}
				Serial.write('\n');
			}
			//#endif

			if (M68_HADDR_PIN == IO_SPACE_HADDR) {
				//Serial.write('S');
				//Serial.write('\n');
				switch (M68_LADDR_PIN) {
				    case 0x01:
					M68_LDATA_PORT = ((serial_read_head != serial_read_tail) ? 0x01 : 0x00) | ((serial_write_head == serial_write_tail) ? 0x04 : 0x00);
					break;
				    case 0x03:
					register byte val = serial_get_byte();
					//Serial.write(val);
					M68_LDATA_PORT = val;
					break;
				    case 0x0e:
					M68_LDATA_PORT = digitalRead(13);
					break;
				    default:
					break;
				}
			}
			else {
				if (M68_IS_LDS())
					M68_LDATA_PORT = (addr < mem_size) ? mem[addr + 1] : 0x00;
				if (M68_IS_UDS())
					M68_HDATA_PORT = (addr < mem_size) ? mem[addr] : 0x00;
			}

			//delayMicroseconds(1000);

			noInterrupts();
			M68_ASSERT_DTACK();
			//INLINE_NOP;
			M68_UNASSERT_DTACK();
			M68_LDATA_DDR = 0x00;
			M68_HDATA_DDR = 0x00;
			interrupts();
		}
		// Write Operation
		else if (M68_IS_WRITE()) {
			//#if WRITE_BUS_DEBUG
			if (WRITE_BUS_DEBUG || (trace && addr >= ROM_SIZE)) {
				Serial.write('W');
				Serial.print(addr, HEX);
				Serial.write('|');
				register word data = (M68_HDATA_PIN << 8) | M68_LDATA_PIN;
				Serial.print(data, HEX);
				Serial.write('\n');
			}
			//#endif

			if (M68_HADDR_PIN == IO_SPACE_HADDR) {
				//Serial.write('X');
				//Serial.write('\n');
				switch (M68_LADDR_PIN) {
				    case 0x03:
					Serial.write(M68_LDATA_PIN);
					//serial_add_byte(M68_LDATA_PIN);
					break;
				    case 0x0c:
					trace = (M68_LDATA_PIN & 0x01);
					Serial.println(trace ? "Trace On" : "Trace Off");
					break;
				    case 0x0e:
					digitalWrite(13, (M68_LDATA_PIN & 0x01));
					break;
				    default:
					break;
				}
			}
			else if (addr < mem_size) {
				if (!WRITE_PROTECT || addr >= ROM_SIZE) {
					if (M68_IS_LDS())
						mem[addr + 1] = M68_LDATA_PIN;
					if (M68_IS_UDS())
						mem[addr] = M68_HDATA_PIN;
				}
			}

			//delayMicroseconds(1000);

			noInterrupts();
			M68_ASSERT_DTACK();
			//INLINE_NOP;
			M68_UNASSERT_DTACK();
			interrupts();
		}
	}

	PCICR = 0x01;
	//interrupts();
}

//
// Print debug information on the bus cycles and provide DTACK signal without responding to the request
//
// This is used when the computer jumpers are set to run the program from the onboard Flash memory, but allows
// each memory access to be observed
//
void snoop_bus_cycle()
{
	if (bus_request) {
	PCICR = 0x00;

	if (M68_IS_AS()) {
		// Read Operation
		if (M68_IS_READ()) {
			register word addr = ((M68_HADDR_PIN << 8) | M68_LADDR_PIN) << 1;
			register byte type = M68_IS_UDS() & M68_IS_LDS();

			Serial.write('R');
			Serial.print(addr, HEX);
			if (addr < mem_size) {
				Serial.write('|');
				Serial.print((mem[addr] << 8) | mem[addr + 1], HEX);
			}
			Serial.write(type ? 'w' : 'b');
			Serial.write('\n');

			noInterrupts();
			M68_ASSERT_DTACK();
			INLINE_NOP;
			INLINE_NOP;
			M68_UNASSERT_DTACK();
			interrupts();
		}
		// Write Operation
		else if (M68_IS_WRITE()) {
			register word addr = ((M68_HADDR_PIN << 8) | M68_LADDR_PIN) << 1;

			Serial.write('W');
			Serial.print(addr, HEX);
			Serial.write('|');
			register word data = (M68_HDATA_PIN << 8) | M68_LDATA_PIN;
			Serial.print(data, HEX);
			Serial.write('\n');

			noInterrupts();
			M68_ASSERT_DTACK();
			INLINE_NOP;
			INLINE_NOP;
			M68_UNASSERT_DTACK();
			interrupts();
		}
	}

	bus_request = 0;
	PCIFR = 0x00;
	PCICR = 0x01;
	//interrupts();
	}
}


inline void write_data(long addr, word data)
{
	M68_HDATA_DDR = 0xFF;
	M68_LDATA_DDR = 0xFF;

	M68_HDATA_PORT = (byte) (data >> 8);
	M68_LDATA_PORT = (byte) data;

	M68_XADDR_PORT = (byte) (addr >> 17);
	M68_HADDR_PORT = (byte) (addr >> 9);
	M68_LADDR_PORT = (byte) (addr >> 1);

	digitalWrite(M68_RW, 0);
	digitalWrite(M68_LDS, 0);
	digitalWrite(M68_UDS, 0);
	digitalWrite(M68_AS, 0);
	delayMicroseconds(1);
	digitalWrite(M68_AS, 1);
	digitalWrite(M68_LDS, 1);
	digitalWrite(M68_UDS, 1);
	digitalWrite(M68_RW, 1);
	INLINE_NOP;

	M68_HDATA_DDR = 0x00;
	M68_LDATA_DDR = 0x00;
}

inline word read_data(long addr)
{
	byte hvalue = 0;
	byte lvalue = 0;

	M68_HDATA_DDR = 0x00;
	M68_LDATA_DDR = 0x00;

	M68_XADDR_PORT = (byte) (addr >> 17);
	M68_HADDR_PORT = (byte) (addr >> 9);
	M68_LADDR_PORT = (byte) (addr >> 1);

	digitalWrite(M68_RW, 1);
	digitalWrite(M68_LDS, 0);
	digitalWrite(M68_UDS, 0);
	digitalWrite(M68_AS, 0);
	delayMicroseconds(1);
	hvalue = M68_HDATA_PIN;
	lvalue = M68_LDATA_PIN;
	digitalWrite(M68_AS, 1);
	digitalWrite(M68_LDS, 1);
	digitalWrite(M68_UDS, 1);
	INLINE_NOP;

	return (hvalue << 8) | lvalue;
}

void 
run_read_test()
{
	int hvalue = 0;
	int lvalue = 0;
	int errors = 0;

	set_bus_mode_controller();
	Serial.print("Running Read Test\n");

	M68_HDATA_PORT = 0x00;
	M68_HDATA_DDR = 0x00;
	M68_LDATA_PORT = 0x00;
	M68_LDATA_DDR = 0x00;

	M68_XADDR_PORT = 0x80;
	M68_HADDR_PORT = 0;
	M68_LADDR_PORT = 0;
	digitalWrite(M68_RW, 1);


	Serial.print(MEM_ADDR, HEX);
	Serial.print(" ");
	for (long i = 0; i < MEM_SIZE / 2; i++) {
		long addr = MEM_ADDR + (i << 1);

		M68_XADDR_PORT = (byte) (addr >> 17);
		M68_HADDR_PORT = (byte) (addr >> 9);
		M68_LADDR_PORT = (byte) (addr >> 1);

		digitalWrite(M68_AS, 0);
		digitalWrite(M68_LDS, 0);
		digitalWrite(M68_UDS, 0);

		delayMicroseconds(1);
		INLINE_NOP;
		hvalue = M68_HDATA_PIN;
		lvalue = M68_LDATA_PIN;

		digitalWrite(M68_AS, 1);
		digitalWrite(M68_LDS, 1);
		digitalWrite(M68_UDS, 1);

		delayMicroseconds(1);
		M68_XADDR_PORT = 0x80;
		M68_HADDR_PORT = 0;
		M68_LADDR_PORT = 0;

		if (hvalue != (i & 0x00FF))
			errors += 1;
		if (lvalue != (i & 0x00FF))
			errors += 1;
		if (hvalue < 10) Serial.print("0");
		Serial.print(hvalue, HEX);
		if (lvalue < 10) Serial.print("0");
		Serial.print(lvalue, HEX);
		Serial.print(" ");
		if (i % 32 == 31) {
			Serial.print("\n");
			Serial.print(addr, HEX);
			Serial.print(" ");
		}
	}

	Serial.print("\n");
	Serial.print("Errors: ");
	Serial.print(errors, DEC);
	Serial.print("\n");
}

